window.bookSummaryJSON = "<p><b>Look but don't touch…</b></p> <p>The night she showed up at my bar with a fake ID, I kicked her out. On her birthday, the following week, she showed up again. Except this time, she was demanding a job and willing to do whatever it took to get it.</p> <p>Against my better judgment, she got her way, but I'm not going to make it easy on her. Neither are the guys at my bar.</p> <p>I have two choices: Pretend she's mine to protect her. Or deal with the consequences when her five older, overprotective brothers find out what their little sister is up to.</p> <p>Either way… It's going to be hell on me.</p> <p>Because I can't stay away from her.</p> <p>From <i>Wall Street Journal </i>and <i>USA Today</i> bestselling author M. Robinson comes an enemies-to-lovers, forbidden standalone romance.</p>"; 
